<style>
      @font-face {

        height: 100%;
        width: 100%;
        margin: 0;
        padding: 0;
        overflow: hidden;
      }

      body {
        background: rgb(86, 20, 205);

        display: flex;
        flex-flow: column;
        align-items: center;
        justify-content: center;
        color: white;

        height: calc(100vh - 80px);

      .footer {
        height: 80px;
        display: flex;
        flex-flow: column;
        align-items: center;
        justify-content: center;
      }

      img.logo {
        width: 150px;
      }

      img.ico {
        width: 130px;
      }

      p {
        max-width: 600px;
        font-size: 28px;
        text-align: center;
        margin: 40px 0 0;
      }
    </style>
</head>
